def main():
    N, M, X, Y = map(int, input().split())
    x_list = list(map(int, input().split()))
    y_list = list(map(int, input().split()))

    if X >= Y:
        print("War")
        return

    if X < min(x_list) or max(y_list) < Y:
        print("War")
        return

    x_list.sort()
    y_list.sort()

    for i in range(X + 1, Y):
        if i > min(x_list) and i <= max(y_list):
            print("No War")
            return
        else:
            if i > min(x_list):
                x_list.pop(0)
            if i <= max(y_list):
                y_list.pop()

    print("War")
    return

